import Image from '../../components/Image/Image'

const Clients = ({
  data, 
  isDarkTheme}) => {
  const {lightThemeClients, darkThemeClients} = data
  const clientsTheme = isDarkTheme 
    ? darkThemeClients 
    : lightThemeClients

  return (
    <section
      className={className ? className : 'clients'}
    >    
      <div className={`${className}__wrapper`}>
        {clientsTheme.length && (
          clientsTheme.map(client => 
            <Image 
              dataType={className} 
              image={client} 
              key={client.source}
            />
          )
        )}
      </div>
    </section>      
  )
}

export default Clients
